import javax.xml.namespace.QName
                                def result = displayName


                                object = focus
                                while (object) {
                                    parents = midpoint.getParentOrgsByRelation(object,
                                            new QName("http://midpoint.evolveum.com/xml/ns/public/common/org-3", "default"))
                                    if(parents.isEmpty() || parents.size() > 1) {
                                        break
                                    }
                                    def parent = parents.iterator().next()
                                    result = result + "," + parent?.getDisplayName()
                                    object = parent
                                }
                                return result

